import Paper from "@material-ui/core/Paper";
import { withStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import React from "react";

const StyledTableCell = withStyles(theme => ({
  head: {
    backgroundColor: "#3f51b5",
    color: theme.palette.common.white
  },
  body: {
    fontSize: 14
  }
}))(TableCell);

const StyledTableRow = withStyles(theme => ({
  root: {
    "&:nth-of-type(odd)": {}
  }
}))(TableRow);

export default class Transaction extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      transactions: null
    };
  }

  componentDidMount() {
    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    let url = "https://stockymanager.azurewebsites.net/api/Transaction";

    fetch(proxyurl + url)
      .then(response => response.json())
      .then(data => this.setState({ data }))
      .catch(() =>
        console.log("Can’t access " + url + " response. Blocked by browser?")
      );
  }
  render() {
    const useStyles = {
      maxHeight: "50vh"
    };
    const { data } = this.state;

    console.log(data);
    return (
      <TableContainer component={Paper}>
        <Table stickyHeader style={useStyles} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>Id</StyledTableCell>
              <StyledTableCell align="right">Transaction Time</StyledTableCell>
              <StyledTableCell align="right">Status</StyledTableCell>
              <StyledTableCell align="right">Shares Quantity</StyledTableCell>
              <StyledTableCell align="right">Time Approve</StyledTableCell>
              <StyledTableCell align="right">Series Id</StyledTableCell>
              <StyledTableCell align="right">
                Transaction TypeId
              </StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data &&
              data.map((row, index) => (
                <StyledTableRow key={index}>
                  <StyledTableCell component="th" scope="row">
                    {row.id}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.transactionTime}
                  </StyledTableCell>
                  <StyledTableCell align="right">{row.status}</StyledTableCell>
                  <StyledTableCell align="right">
                    {row.sharesQuantity}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.timeApprove}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.seriesId}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.transactionTypeId}
                  </StyledTableCell>
                </StyledTableRow>
              ))}
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
}
